package org.brainteam.lunchbox.json;public class JsonOrdererDetail {	private Long userId;	private String userName;	private Integer times;		public Long getUserId() {		return userId;	}		public void setUserId(Long userId) {		this.userId = userId;	}		public String getUserName() {		return userName;	}		public void setUserName(String userName) {		this.userName = userName;	}		public Integer getTimes() {		return times;	}		public void setTimes(Integer times) {		this.times = times;	}	}